import React from "react";
import "./Checkbox.css";

const Checkbox = ({ key, label, value, onChange }) => {
  return (
    <label
      className="container"
      onClick={() => onChange({ key: key, label: label, value: !value })}
    >
      <input type="checkbox" checked={value} />
      <span className="checkmark"></span>
      {label}
    </label>
  );
};

export default Checkbox;
